/*
import React , {useState} from "react";
import "./index.css";

const App = () =>{
    let newTime = new Date().toLocaleTimeString();
const[ctime,setTime] = useState(newTime);
const updateTime = () =>{
    newTime = new Date().toLocaleTimeString(); 
   setTime(newTime);
}
    return(
    <>
    <h1>{newTime}</h1>
    <button onClick={updateTime}> Get Time</button>
    </>
    );
}
export default App;*/
